const ul=document.querySelector(".navbar-nav");if(ul){const t=[...ul.getElementsByTagName("li")];t.forEach(c=>{c.addEventListener("click",(function(){this.classList.contains("active")||(clearActives(t),this.classList.toggle("active"))}))})}function clearActives(t){t&&t.forEach((t,c)=>{t.classList.remove("active")})}